        {
            {0, Indices},
            {1, Top},
            {2, Bottom},
            {4, Left},
            {8, Right},
            {1 | 2, TopBottom},
            {4 | 8, LeftRight},
            {1 | 4, TopLeft},
            {1 | 8, TopRight},
