        public static int[] generateIndices()
        {
            var indices = new List<int>();
            for (int y = 0; y < MeshGenerator.CHUNK_SIZE; y++)
            {
                for (int x = 0; x < MeshGenerator.CHUNK_SIZE; x++)
                {
                    if (y == 0)
                    {
                        // TOP
                        if (x % 2 == 0)
                        {
                            if (x != 0)
                            {
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            }

                            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 2));

                            if (x != MeshGenerator.CHUNK_SIZE - 2)
                            {
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 2));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 2));
                            }
                        }
                    }

                    if (y == MeshGenerator.CHUNK_SIZE - 1)
                    {
                        // BOTTOM
                        if (x % 2 == 0)
                        {
                            if (x != 0)
                            {
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            }

                            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 2));

                            if (x != MeshGenerator.CHUNK_SIZE - 2)
                            {
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 2));
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 2));
                            }
                        }
                    }

                    if (x == 0)
                    {
                        // LEFT
                        if (y % 2 == 0)
                        {
                            if (y != 0)
                            {
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            }

                            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                            indices.Add((y + 2) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));

                            if (y != MeshGenerator.CHUNK_SIZE - 2)
                            {
                                indices.Add((y + 2) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 2) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            }
                        }
                    }

                    if (x == MeshGenerator.CHUNK_SIZE - 1)
                    {
                        // RIGHT
                        if (y % 2 == 0)
                        {
                            if (y != 0)
                            {
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                                indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                            }

                            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                            indices.Add((y + 2) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));

                            if (y != MeshGenerator.CHUNK_SIZE - 2)
                            {
                                indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 2) * (MeshGenerator.CHUNK_SIZE + 1) + (x));
                                indices.Add((y + 2) * (MeshGenerator.CHUNK_SIZE + 1) + (x + 1));
                            }
                        }
                    }

                    if (y != 0 && y != MeshGenerator.CHUNK_SIZE - 1 && x != MeshGenerator.CHUNK_SIZE - 1 && x != 0)
                        addStandardTileIndices(indices, y, x);
                }
            }

            return indices.ToArray();
        }

        private static void addStandardTileIndices(List<int> indices, int y, int x)
        {
            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + x + 0);
            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + x + 0);
            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + x + 1);

            indices.Add((y + 0) * (MeshGenerator.CHUNK_SIZE + 1) + x + 1);
            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + x + 0);
            indices.Add((y + 1) * (MeshGenerator.CHUNK_SIZE + 1) + x + 1);
        }
    }
